# encoding: utf-8
# 会超时
class Solution:
    def twoSum(self, numbers, target):
        """
        :type numbers: List[int]
        :type target: int
        :rtype: List[int]
        """
        result = []
        for i in range(len(numbers) - 1):
            if target - numbers[i] in numbers[i + 1:]:
                result.append(i + 1)
                result.append(numbers[i + 1:].index(target - numbers[i]) + i + 2)
                return result


r = Solution()
